import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  const [cellOne, setCellOne] = useState("No")
  const handleChange = (num) => {
    console.log(num)
  }

  return (
    <div className='App'>
      <header className="App-header">
        <h1>Tic-Tac-Toe Game</h1>
      </header>
      <div>Sina</div>
      <table>
        <tbody>
          <tr>
            <td>
              <input type="checkbox" onChange={() => handleChange(1)}></input>
              <text>Filled out: {cellOne}</text>
            </td>
            <td><input type="checkbox" onChange={() => handleChange(2)}></input></td>
            <td><input type="checkbox" onChange={() => handleChange(3)}></input></td>
          </tr>

          <tr>
            <td><input type="checkbox" onChange={() => handleChange(4)}></input></td>
            <td><input type="checkbox" onChange={() => handleChange(5)}></input></td>
            <td><input type="checkbox" onChange={() => handleChange(6)}></input></td>
          </tr>

          <tr>
            <td><input type="checkbox" onChange={() => handleChange(7)}></input></td>
            <td><input type="checkbox" onChange={() => handleChange(8)}></input></td>
            <td><input type="checkbox" onChange={() => handleChange(9)}></input></td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default App;
